INSERT INTO `mensaje` VALUES (1,'100303631@alumnos.uc3m.es','2016-12-18','Buenos días, \r\n\r\nNecesitaría presupuesto para realizar una aplicación web orientada a la venta de productos, sería algo similar a Wallapop.\r\n\r\nUn saludo!','100307011@alumnos.uc3m.es'),(2,'100307011@alumnos.uc3m.es','2016-12-18','Buenas tardes,\r\n\r\nLe pasaré varios presupuestos en función de las características que desee.\r\n\r\nUn saludo.','100303631@alumnos.uc3m.es'),(3,'100303631@alumnos.uc3m.es','2016-12-18','De acuerdo, muchísimas gracias por todo.\r\n\r\nMe pongo a la espera de noticias suyas.','100307011@alumnos.uc3m.es');
